import React from 'react';

const RoomHeader = ({ roomId, creatorId, onAddClick }) => {
  return (
    <div className="room-header">
      <div className="header-content">
        <div className="room-info">
          <h1>Room: <span>{roomId}</span></h1>
          <p className="creator-info">Created by: <span>{creatorId}</span></p>
        </div>
        <div className="header-actions">
          <button className="primary-button" onClick={onAddClick}>
            + Add Profile
          </button>
          <button
            className="secondary-button"
            onClick={() => window.location.href = `/room/${roomId}/teamswithproposal`}
          >
            View Proposals
          </button>
        </div>
      </div>
    </div>
  );
};

export default RoomHeader;
